import { ReactComponent as BookLogo } from './images/svg/book.svg'
import './App.css'
import { Router } from './router'
import { FormProvider } from './contexts/FormContext'

const App = () => {
  return (
    <>
      <FormProvider>
        <Router></Router>
        <BookLogo className='teste'></BookLogo>
        <p>teste</p>
      </FormProvider>
    </>

  )
}

export default App;
